import React from "react";

const PredictedCareer = ({ career }) => {
  return (
    <div className="bg-white rounded-lg shadow-lg p-6 text-center">
      <h2 className="text-2xl font-semibold text-gray-700 mb-2">
        Your Predicted Career Path
      </h2>
      <div className="text-4xl font-bold text-indigo-600 mb-4">{career}</div>
      <p className="text-gray-600">
        Based on your skills and interests, this career path aligns best with
        your profile.
      </p>
    </div>
  );
};

export default PredictedCareer;
